import React, {useState} from 'react';
import '../assets/css/navbar.css';
import { ReactComponent as LogoImg } from '../assets/images/logo2.png';

const NavBar = () => {
    return (
        <nav className='navbar navbar-expand-lg navbar-light' id='navigation-menu'>
            <a className="navbar-brand" href="#" id="logo">
                <img src={require("../assets/images/logo2.png")} alt="logo" />
                Joseph Bautista
            </a>

            <button class="navbar-toggler" id="navbar-button" type="button" data-toggle="collapse" data-target="#navbarNav">
			<span class="navbar-toggler-icon"></span>

            <div class="collapse navbar-collapse" id="navbarNav">
                <ul class="navbar-nav ml-auto">
                    <li class="nav-item">
                        <a class="nav-link nav-text active" href="index.html" id="home">Home</a>
                    </li>

                    <li class="nav-item ">
                        <a class="nav-link nav-text" href="profile.html" id="profile">Profile</a>
                    </li>

                    <li class="nav-item ">
                        <a class="nav-link nav-text" href="projects.html" id="projects">Projects</a>
                    </li>


                </ul>
            </div>

		</button>
        </nav>
    );
};

export default NavBar;
